import React from 'react';
import styled from '@emotion/styled';

const Layout = styled.div`
  width: 100%;
  height: 100%;
  position: relative;
  overflow: hidden;

  canvas {
    display: block;
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    z-index: 1;
    background: transparent;
    z-index: 100;
  }

  img {
    position: relative;
    left: -10%;
    opacity: 0;
  }
`;

const Canvas = () => {
  return (
    <Layout>
      <canvas id="canvas1"></canvas>
      <img
        src="data:image/png;base64,"
        id="image"
      />
    </Layout>
  );
};

export default Canvas;

